const PlasmicDescendants = {
  root: [
    "root",
    "layerDefault",
    "bodyContent",
    "headContent",
    "h1",
    "section",
    "columns",
    "link"
  ],

  layerDefault: [
    "layerDefault",
    "bodyContent",
    "headContent",
    "h1",
    "section",
    "columns",
    "link"
  ],

  bodyContent: [
    "bodyContent",
    "headContent",
    "h1",
    "section",
    "columns",
    "link"
  ],

  headContent: ["headContent", "h1"],
  h1: ["h1"],
  section: ["section", "columns", "link"],
  columns: ["columns", "link"],
  link: ["link"]
};

function makeNodeComponent(nodeName) {
  const func = function (props) {
    const { variants, args, overrides } = React.useMemo(
      () =>
        deriveRenderOpts(props, {
          name: nodeName,
          descendantNames: PlasmicDescendants[nodeName],
          internalArgPropNames: PlasmicPricing__ArgProps,
          internalVariantPropNames: PlasmicPricing__VariantProps
        }),
      [props, nodeName]
    );
    return PlasmicPricing__RenderFunc({
      variants,
      args,
      overrides,
      forNode: nodeName
    });
  };
  if (nodeName === "root") {
    func.displayName = "PlasmicPricing";
  } else {
    func.displayName = `PlasmicPricing.${nodeName}`;
  }
  return func;
}

export const PlasmicPricing = Object.assign(
  // Top-level PlasmicPricing renders the root element
  makeNodeComponent("root"),
  {
    // Helper components rendering sub-elements
    layerDefault: makeNodeComponent("layerDefault"),
    bodyContent: makeNodeComponent("bodyContent"),
    headContent: makeNodeComponent("headContent"),
    h1: makeNodeComponent("h1"),
    section: makeNodeComponent("section"),
    columns: makeNodeComponent("columns"),
    link: makeNodeComponent("link"),
    // Metadata about props expected for PlasmicPricing
    internalVariantProps: PlasmicPricing__VariantProps,
    internalArgProps: PlasmicPricing__ArgProps,
    // Page metadata
    pageMetadata: {
      title: "",
      description: "",
      ogImageSrc: "",
      canonical: ""
    }
  }
);

export default PlasmicPricing;
